( function() {

	// access to window object cross-browser
	var uW;
	if (typeof unsafeWindow === 'object') {
		uW = unsafeWindow;
	} else {
		uW = window;
	}

	// get jQuery
	var $ = uW.jQuery;

	// add a console function
	var l;
	if (typeof uW.console === 'object' && typeof uW.console.log === 'function') {
		l = uW.console.log;
	} else {
		l = function() {
			return false;
		};
	}

	// cookie-based alternative for GM_*Value functions
	var value, newValueLib = function(prefix) {
		var prefix = 'tilx_' + prefix + '_';

		// cookie-functions by Peter-Paul Koch
		// (http://www.quirksmode.org/js/cookies.html#script)
		var createCookie = function(name, value, days) {
			var expires = "";
			if (days) {
				var date = new Date();
				date.setTime(date.getTime() + (days * 24 * 60 * 60 * 1000));
				expires = "; expires=" + date.toGMTString();
			}
			document.cookie = name + "=" + value + expires + "; path=/";
		};
		var readCookie = function(name) {
			var nameEQ = name + "=";
			var ca = document.cookie.split(';');
			for ( var i = 0; i < ca.length; i++) {
				var c = ca[i];
				while (c.charAt(0) == ' ') {
					c = c.substring(1, c.length);
				}
				if (c.indexOf(nameEQ) == 0) {
					return c.substring(nameEQ.length, c.length);
				}
			}
			return undefined;
		};

		return {
			set : function(name, value) {
				createCookie(prefix + name, value, 365);
			},
			get : function(name, def) {
				var ret = readCookie(prefix + name);
				if (ret !== undefined) {
					return ret;
				} else {
					return def;
				}
			}
		};
	};

	// Object.create() by Douglas Crockford
	if (typeof Object.create !== 'function') {
		Object.create = function(o) {
			var F = function() {
			};
			F.prototype = o;
			return new F();
		};
	}
	
	// The script
	var QuickBar = ( function() {

		var images = {
			'quick_bar' :'data:image/png;base64,%3D%3D'
		};
		
		var controllers = {
			'main' : 'building_main',
			'academy' : 'building_academy',
			'barracks' : 'building_barracks',
			'docks' : 'building_docks',
			'place' : 'building_place',
		}
		
		var townId = parseInt(uW.Game.townId, 10);
		var csrfToken = uW.Game.csrfToken;
		var controller = 'index';
		
		var setBarPosition = function(){
			
		};
		
		return function() {
			
			//var pos = setBarPosition;
			var map = '<map name="Quickbar">'
				+'<area shape=rect coords="9,4,85,26" href="./'+controllers.main+'?town_id='+townId+'&action=index&h='+csrfToken+'" alt="Vers le sénat">'
				+'<area shape=rect coords="86,4,182,26" href="./'+controllers.barracks+'?town_id='+townId+'&action=index&h='+csrfToken+'" alt="Vers la caserne">'
				+'<area shape=rect coords="183,4,250,26" href="./'+controllers.docks+'?town_id='+townId+'&action=index&h='+csrfToken+'" alt="Vers le port">'
				+'<area shape=rect coords="251,4,329,26" href="./'+controllers.place+'?town_id='+townId+'&action=index&h='+csrfToken+'" alt="Vers l\'agora">'
				+'<area shape=rect coords="339,4,448,26" alt="Pas encore de fonctionnalité...">'
				+'</map>';
			var html = map
				+ '<img usemap="#Quickbar" alt="Embedded Image" width="576" height="30" src="'
				+ images.quick_bar
				+ ' />'
			
			$('#bar_content').append(html);
		}

	}());
	
	
	
	QuickBar();
	autoUpdate (85192, "0.1.6");

}());
